import React from 'react';
import './FlightResults.css';
import { airports } from '../data/airports';

function calculateDirectDistance(origin, destination) {
  const originAirport = airports.find(a => a.IATA === origin);
  const destAirport = airports.find(a => a.IATA === destination);

  if (!originAirport || !destAirport) return null;

  const R = 3959; // Earth's radius in miles
  const lat1 = originAirport.Latitude * Math.PI / 180;
  const lat2 = destAirport.Latitude * Math.PI / 180;
  const dLat = (destAirport.Latitude - originAirport.Latitude) * Math.PI / 180;
  const dLon = (destAirport.Longitude - originAirport.Longitude) * Math.PI / 180;

  const a = Math.sin(dLat/2) * Math.sin(dLat/2) +
           Math.cos(lat1) * Math.cos(lat2) *
           Math.sin(dLon/2) * Math.sin(dLon/2);

  const c = 2 * Math.atan2(Math.sqrt(a), Math.sqrt(1-a));
  return Math.round(R * c);
}

export function FlightResults({ results, isVisible }) {
  if (!isVisible || !results || results.length === 0) return null;

  // Find direct route if it exists
  const directRoute = results.find(route => route.length === 1);

  // Calculate direct distance (even if no direct flight exists)
  const directDistance = calculateDirectDistance(
    results[0][0].Departure_IATA,
    results[0][results[0].length - 1].Arrival_IATA
  );

  // Sort routes: direct first, then by number of stops
  const sortedResults = [
    ...(directRoute ? [directRoute] : []),
    ...results.filter(route => route.length > 1)
      .sort((a, b) => {
        // Sort by number of stops first
        const stopsDiff = (a.length - 1) - (b.length - 1);
        if (stopsDiff !== 0) return stopsDiff;

        // If same number of stops, sort by total distance
        const distanceA = a.reduce((sum, segment) => sum + segment.Distance, 0);
        const distanceB = b.reduce((sum, segment) => sum + segment.Distance, 0);
        return distanceA - distanceB;
      })
  ];

  return (
    <div className="results-container">
      <div className="direct-distance">
        Direct Distance: {directDistance} miles
      </div>
      <table className="flight-results">
        <thead>
          <tr>
            <th>Departure</th>
            <th>Arrival</th>
            <th># of Stops</th>
            <th>Layovers</th>
            <th>Distance Difference</th>
            <th>Economy</th>
            <th>Premium</th>
            <th>Business</th>
            <th>First</th>
          </tr>
        </thead>
        <tbody>
          {sortedResults.map((itinerary, index) => {
            const numStops = itinerary.length - 1;
            const layovers = itinerary
              .slice(0, -1)
              .map((segment, idx) => segment.Arrival_IATA)
              .join(' → ');

            // Calculate total itinerary distance
            const totalDistance = itinerary.reduce((sum, segment) => sum + segment.Distance, 0);

            // Calculate percentage difference
            const percentageDiff = directDistance 
              ? Math.round(((totalDistance / directDistance) - 1) * 100) 
              : null;

            const isDirect = itinerary.length === 1;

            return (
              <tr key={index} className={isDirect ? 'direct-route' : ''}>
                <td>{itinerary[0].Departure_IATA}</td>
                <td>{itinerary[itinerary.length - 1].Arrival_IATA}</td>
                <td>{numStops}</td>
                <td className="layovers">{layovers || '-'}</td>
                <td>{percentageDiff === 0 ? 'Direct' : `+${percentageDiff}%`}</td>
                <td>-</td>
                <td>-</td>
                <td>-</td>
                <td>-</td>
              </tr>
            );
          })}
        </tbody>
      </table>
    </div>
  );
}
